    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      {/* <a class="navbar-brand" href="#">Employee Directory</a> */}
      <div className="collapse navbar-collapse row" id="navbarNav">
        <div className="search-area col-4">
          <FilterName />
        </div>
